import styled from 'styled-components';


const Container = styled("div")`
width: 100vw;
height: 100px;
background-color: #40E0D0;
display: flex;
justify-content: center;
align-items: center;
`
const Title = styled("h1")`
    margin: 0;
    font-family: 'Bungee', cursive;
`

const Navbar = () => {
    return (
        <Container>
            <Title>
                Monsters
            </Title>
        </Container>
    )
}
export default Navbar;
